          'Priced per pair.\r\nOne of the longest produced Bungalow or Cottage style porch light manufactured. Probably started in the 20s and continued into the 50s, some even made in Japan for the US market. \r\nThese vintage outdoor fixtures appear to be some of the earlier ones as they have 3 screws securing the glass cage to the bottom of the "witches hat" top and the later ones only had 2 screws. Also these have their original vintage glass shades and the later ones had plastic shades. There looks to be be a remnant of a "Harmony House" sticker loose in one of them.\r\nGreat charmers with a slight warm or amber paint on the glass. All 6 pieces of glass in excellent condition with no noticeable chips or cracks.\r\nUnusual to find a matched set of 6 of any antique porch lights, especially ones with such great style and charm. \r\nOnly 4 remain available.\r\nHeight: 9 1/2 inches\r\nWidth: 5 1/2 inches\r\nProjection: 8 inches\r\n\r\n',
