        description:
          'Wonderful colors, superb detailing, & crisp casting\r\n\r\n\r\nThese late 20s to early 30s vintage wall sconces by Gill Mfg. are so desirable they are rarely seen for sale.  This is only the second pair of these antique fixtures we have had in over 15 years (and one single).  \r\nJust a wonderful design with touches of art deco to victorian to the revival styles.  Made of cast brass, the detailing is concise and the casting is crisp (crisp is a term used to describe the actual casting, denoting sharp edges, clean lines, a lack of voids, the smallest of detailing is seen, and no excess material around the edges). \r\nThe colors are still strong with just enough muting in the greens and reds so as not to detract from the beauty of the glass.  The glass itself is a custard glass, which emits a warm and comforting glow when lit.  The design on the glass is screened on by hand, then fired on, so each one will be slightly different.  No noticable loss of paint on the glass.  \r\nThey are in their "as found" condition with only a brief cleaning with a water dampened cloth, and they have been rewired.  We retained their original sockets and candle sleeves.  \r\nThese are so interesting and captivating they will creat a strong presence in any room. \r\nThese are all the things you look for in a completely original vintage pair of wall sconces, which have only been upgraded to perform safely.\r\nHeight: 10 1/2 inches\r\nProjection: 4 inches',
