        description:
          'Two available, priced each\r\nAlthough almost 80 years old, this antique lighting fixture still retains part of its original paper sticker from Porcelier.  \r\nDuring the teens and into the 1930s there was a design style known as the "Sanitized" look.  It was toted as easy to clean and to keep "sanitized" and the look was characterized as white on white with non-porous surfaces such as tile (subway tile is one example), porcelain (from light fixtures, door knobs, to the kitchen sink), and glass.  White milk glass was the popular choice back then for vintage lighting shades and remains a very popular choice to this day, with original vintage schoolhouse style globes in high demand.  It was first seen in hospitals and other institutions and the style quickly spread to residential homes throughout North America.  This design influence is still very popular today.\r\n\r\nThis example has a vintage light shade which is embossed with a Deco inspired Swan in the center and stylized waves under the Swan and along the bottom of the glass shade.  The antique white porcelain back carries a vintage over sized white milk glass shade.  The pull switch mechanism has been completely dis-assembled, cleaned, and rebuilt to insure it will operate smoothly for another several decades.  Outlet has been de-activated for safety concerns.\r\nHeight: 6 1/8 inches\r\nWidth: 8 1/4 inches\r\nProjection: 7 inches\r\n\r\n\r\n',
