          "Stock images\r\nPriced per pair.  3rd available at 1/2 pair price\r\nA great pair of vintage 1920s -1930s Art Deco inspired wall sconce lighting fixtures made by Virden, one of the very few surviving lighting manufacturers from that era.  Sometimes called the \"Rayburn\" line of lighting fixtures, seen in late '20s through mid '30s Sears catalogs.\r\nClean lines, simple design, and fitting proportions create a dynamic & vibrant wall light slip shade fixture so typical of the Art Deco era.  These sconces have been refinished in an original Virden color scheme, Sunset Golden, with a warm dark amber in the recesses and just enough contrast so the focus is on the design elements and not on the colors of the fixture. The pattern of the stylized flower, front and center on the fixture, is also present on the front of the glass slip shades. The shades are honey amber, however, they take on a warm orange hue due to the low wattage bulbs used in photographing them. Their color is accurately shown in the images where the light bulb is off.\r\n Fixtures have been rewired using UL listed parts, tested, and come with mounting hardware.\r\n Height: 12 1/4 inches\r\n Width: 6 1/4 inches\r\n Projection: 4 1/4 inches\r\n 75 watt max.",
