          "Impressive 5 light fixture which shows the mastery of workmanship and design of the Craftsman era.  One of those masterpieces which just do not come along very often.  Another aspect of this wonderful piece is that would work wonderfully in many home style of it day including Craftsman, Tudor, Revival, or Arts & Crafts.  Unique raised pattern on the main fixture body where each of the 4 pieces were soldered together by hand.  All original fixture parts, except wiring.  The original sockets are all marked: PAT'D NOV 26 1907, the paddle switches all work.  It like 6 of the 30 glass panels may have been replaced as they have a different texture on the inside but do look the same on the outside.\r\nThe fixture is solid brass (except the chains) which was disassemble and each piece was professionally patinated by hand to give it the rich warm patina with just enough subtle differences you would expect to see on a 100+ year old fixture.  There are a few age spots remaining, a few spots where the patina is not as dark, and a few very small dings, all which speak to the age and life of this magnificent centerpiece fixture.   \r\nDrop as shown is 42 1/2 inches which can be shortened to fit your needs.  It could lengthened but since the chains are original we may not be able to match any added chains exactly.\r\nWidth is 20 inches across the diagonal of the fixture body and 19 inches across the bottom of the shades.\r\nWidth of ceiling canopy is 4 1/2 inches \r\n60 watt max each socket.",
