        description:
          "We were lucky enough to find a collection of 10 of these very rare Bellova shades in different shades and colors.  They were produced in Czechoslovakia starting in about 1923 and were produced for the HG McFaddin Co., also the manufacturer of Emeralite lamps. They produced many different shades of glass shades in many different colors. One of the most readily identifiable features is the lace pattern painted on the tops and bottoms separated by a band of flowers, along with a unique bottom finial made of glass.  The Bellova shades were signed at the factory with an aluminum paint and like the signature on Steuben shades, it is quite common for the signature to have been erased when washing the glass. \r\n The main body of this shade is blue lace on a white background and a band of tan and orange flowers.  The porcelain ceiling fitter is a solid brass vintage fixture. \r\n The total drop as shown is 11 1/2 inches, which can be adjusted a bit shorter and much longer on a metal chain or pole mount fitter. The\r\n width of the shade is 11 inches.\r\nThe drop can be adjusted longer to your needs.",
